def maxSum(nums):
    if not nums:
        return 0
    n = len(nums)
    if n == 1:
        return nums[0]
    prev_prev = nums[0]
    prev = nums[1]
    for i in range(2, n):
        current = nums[i]
        new_take = current + prev_prev
        new_notake = max(prev, prev_prev)
        prev_prev, prev = prev, new_take
    return max(prev, prev_prev)
